import React from 'react';

const Stats = () => {
    return (
        <div>
            <h2 className="text-2xl font-bold mb-4">Statistiques</h2>
            <p>Ici, vous pouvez visualiser vos statistiques.</p>
            <div className="bg-white p-4 shadow-md rounded-md">
                <h3 className="font-semibold">Statistiques des Utilisateurs</h3>
                <ul>
                    <li>Utilisateurs actifs: 132</li>
                    <li>Nouveaux Utilisateurs du jour: 5</li>
                    <li>Utilisateurs inactifs: 18</li>
                </ul>
            </div>
        </div>
    );
};

export default Stats;
